import React, { Component } from "react";

export default class List extends Component {
  render() {
    const { userList } = this.props;
    return (
      <div className="row">
        {userList.map((user) => {
          return (
            <div key={user.id} className="card">
              <a
                href={user.html_url}
                rel="noreferrer"
                target="_blank"
              >
                <img
                  src={user.avatar_url}
                  alt="head"
                  style={{ width: "100px" }}
                />
              </a>
              <p className="card-text">{user.login}</p>
            </div>
          );
        })}
      </div>
    );
  }
}
